166352.extract:
Žodis alyva reiškia:

alyvos – vasaržalis dekoratyvinis krūmas Syringa, (daugiaskaitinis daiktavardis, vienaskaita nenaudojamas);
alyva, kitaip alyvuogių aliejus – alyvmedžio vaisių alyvuogių aliejus;
mineralinė alyva, tiesiog alyva – alyvos (aliejaus) konsistencijos skystis, gaunamas iš naftos ir naudojamas kaip tepimo medžiaga, elektrinis izoliatorius ir pan.
Seniau žodis alyva reiškė būtent alyvuogių aliejų, kurį iš Viduržemio jūros regiono eksportuodavo ir į Vidurio bei Šiaurės Europą. Tarybiniais metais į Lietuvą alyvos (alyvuogių aliejaus) neįveždavo, tad žodis alyva liko praktiškai nenaudojamas. Tuo tarpu Lietuvoje vis dažniau naudojo iš naftos gaunamą produktą, kuris rusiškai vadinosi минеральное масло (pažodžiui 'mineralinis aliejus'), kurio pavadinimą į lietuvių kalbą vertė kaip mineralinė alyva (ją naudojo, pvz., siuvamosioms mašinoms, dviračiams tepti ir pan.). Kadangi kitokios alyvos Lietuvoje tuo metu nebūdavo, žodis alyva ėmė reikšti būtent 'mineralinė alyva'. Lietuvai atgavus nepriklausomybę ir rinkoje vėl atsiradus tikrosios alyvos, ją teko imti vadinti alyvuogių aliejumi.

